con:config.script:
/*
* TestCase Setup 
* 
* @author  Cigniti
*/
import com.cigniti.soap.ui.core.TestCaseScripts;
def testCaseScripts =  new TestCaseScripts(context).execute();

testStep = testRunner.testCase.getTestStepByName("fullCountryInfo Request");

int count = testStep.getAssertionList().size();
for (i in 0..count-1)
{
	if (testStep.getAssertionAt(i).getName().toString().equals("XPath Match-sISOCode" )) 
	{
		if (testRunner.testCase.getPropertyValue("sISOCode") == "" || testRunner.testCase.getPropertyValue("sISOCode") == null)
			{
				testStep.getAssertionByName("XPath Match-sISOCode").setDisabled(true)
				log.info "Assertion "+testStep.getAssertionAt(i).getName().toString()+" Disabled !!"
			}
		else {
				testStep.getAssertionByName("XPath Match-sISOCode").setDisabled(false)
				log.info "Assertion "+testStep.getAssertionAt(i).getName().toString()+" Enabled !!"
			}
	}else if ( testStep.getAssertionAt(i).getName().toString().equals("XPath Match-sName")) 
	{
		if (testRunner.testCase.getPropertyValue("sName") == "" || testRunner.testCase.getPropertyValue("sName") == null)
			{
				testStep.getAssertionByName("XPath Match-sName").setDisabled(true)
				log.info "Assertion "+testStep.getAssertionAt(i).getName().toString()+" Disabled !!"
			}
		else {
				testStep.getAssertionByName("XPath Match-sName").setDisabled(false)
				log.info "Assertion "+testStep.getAssertionAt(i).getName().toString()+" Enabled !!"
		}
	}
}

/*
* TestCase TearDown 
* 
* @author  Cigniti
*/
import com.cigniti.soap.ui.core.TestCaseScripts;
def testCaseScripts =  new TestCaseScripts(context).loop(testRunner);

con:testCase.con:tearDownScript:
/*
* TestCase TearDown 
* 
* @author  Cigniti
*/
import com.cigniti.soap.ui.core.report.Reporter;
groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def resultDir = groovyUtils.projectPath+"/"+testRunner.testCase.testSuite.project.getPropertyValue("ProjectReportFolderName")
def tS = testRunner.testCase.testSuite.name

def reportDir = resultDir+"//"+tS;
log.info context.testSuiteFlag
if (context.testSuiteFlag == null){
                if (!new File (reportDir).exists()){
                                new File (reportDir).mkdir()
                }
                Reporter.setReportFolder(''+reportDir);
                Reporter.PrintContext(context);
}

con:testSuite.con:setupScript:
/*
* TestSuite Setup 
* 
* @author  Cigniti
*/
def testCases = testSuite.getTestCaseList()
for(testCase in testCases){
	testCase.setPropertyValue("loopCounter", "1")
	testCase.setPropertyValue("dataHolder", "")
}

context.testSuiteFlag = "true"

